For many people with alopecia or undergoing cancer treatment, a wig is about dignity &amp; respect.

@RepPressley &amp; I just introduced a bill requiring Medicare to cover medically necessary wigs.

We spoke with @VanityFair about why, for us, this is personal. vanityfair.com/news/2021/09/a…

